import React, { useEffect, useState } from 'react'
import axios from "axios";
import { getAllUserRoute } from '../../utils/APIRoutes';

function Contacts() {
  const [contacts, setContacts] = useState([]);
  const [isClicked, setIsClicked] = useState(false);

  useEffect(() => {
    async function fetchData() {
      const data = await axios.get(getAllUserRoute)
      setContacts(data.data);
      console.log(data.data);
    }
    fetchData();
  }, [])

  return (<>
    {isClicked && <div class="modalBackground">
      <div class="modalActive">
        <div class="modalClose">
          <img src="modalCross.svg" />
        </div>
        <div class="modalWindow"></div>
      </div>
    </div>}
    <div>
      <button onClick={() => setIsClicked(true)}>Create new chat</button>
    </div>
    <div>
      {contacts.map((contact, index) => (
        <p key={index}>{contact.firstname} {contact.lastname}</p>
      ))}
    </div>
  </>
  )
}

export default Contacts
